import React, { Component } from "react";
import education from "../../assests/images/education.png"
export default class EducationImg extends Component {
  render() {
    const theme = this.props.theme;
    return (
      <div>
        <img src={education} style={{ width: "400px" }} />
        </div>
    );
  }
}
